import React from 'react';
import classes from './MenuStructure.module.css';
import {NavLink} from 'react-router-dom';
const MenuStructure =(props)=>{
    return(
        <div className = {classes.MenuStructure}>
            <ul className = {classes.OuterList}>
                <li className = {classes.OuterListItem}><i class="mdi mdi-speedometer mr-1"></i>Dashboards<span className = "mdi mdi-chevron-down"></span>
                    <ul className = {classes.InnerList}>
                        <li><a href="#">Ecommerse</a></li>
                        <li><a href="#">CRM</a></li>
                    </ul>
                </li>
                <li className = {classes.OuterListItem}><i class="mdi mdi-buffer mr-1"></i>Даатгал<span className = "mdi mdi-chevron-down"></span>
                    <ul className = {classes.InnerList}>
                        <li><NavLink to = "/daatgal/vehicle">Тээврийн хэрэгсэл</NavLink></li>
                        <li><NavLink to = "/daatgal/gate">Гарц даатгал</NavLink></li>
                        <li><NavLink to = "/daatgal/apartment">Орон сууцны даатгал</NavLink></li>
                    </ul>
                </li>

            </ul>
        </div>
    );
}
export default MenuStructure;
